    return (
    <div className = {classes.InputArea} >
        <input type='text' id='msginput' name='texter' className={classes.inputfield} autoFocus />
        <button className={classes.sendbtn} onclick={props.clicked} type='btuu' name='submit' ><img width='25px' height='25px' src='https://cdn-icons-png.flaticon.com/512/340/340913.png' alt="send-icon"/></button>
    </div>
    );
}

export default textInput;
